import React from "react";

export default function Videoplayercontainer() {
  return (
    <div className="playingVideo">
     <iframe
              title="Youtube Video Play"
              width="980"
              height="500"
              frameBorder="0"
              allowFullScreen
              allow="autoplay"
              // src={`https://www.youtube.com/embed/${videoId}`}
              src={`https://www.youtube.com/watch?v=Qbw-kjWCIBM`}
            ></iframe>
    </div>
  );
}
